import React, { useState } from "react";
import NewspaperLayout from "./NewspaperLayout";
import "../styles/BookAd.css";

const BookAd = () => {
  const [spaceId, setSpaceId] = useState(null);

  // Capture spaceId from NewspaperLayout
  const handleSpaceSelect = (id) => {
    setSpaceId(id);
    console.log("Selected Space ID:", id); // Debugging
  };

  return (
    <div>
      <h2>Book Your Ad</h2>
      <NewspaperLayout onSpaceSelect={handleSpaceSelect} />
    </div>
  );
};

export default BookAd;
